import React, {Component, useState,useContext} from 'react';
import ReactDOM from 'react-dom';
import {UserContext} from "../../providers/UserProvider";
import './navbar.css';
import logo from '../../img/logo.png';
import {Link} from 'react-router-dom';

const Navbar = (props) => {
  const user = useContext(UserContext);
  const {displayName,photoURL} = user || { displayName: "", photoURL: logo };
  const shouldSignIn =  <img src={photoURL} className="userPhoto" /> ;



  return(
    <div className="mx-auto flex justify-between bg-gray-600 w-full md:items-start">
      <div className="block signinBox ml-6 my-5 mb-8 h-10 w-10">
        <p> {user? user.displayName : "Welcome"} </p>
        { !user ? <Link to="/signin">
        <img src={logo} className="userPhoto w-full" />
        </Link>
        :
        <img src={logo} className="userPhoto w-full" />
        }

      </div>
      <ul className="flex flex-row my-5">
        <li className="mx-5 ">
          <Link to="/about">  About </Link>
        </li>
        <li className="mx-5 ">
          <Link to="/about">  News </Link>
        </li>
        </ul>
        <div className="mx-5 my-5 float-right" >
          <Link to="/signUp">  Sign Up  </Link>
        </div>





    </div>
  )

};
export default Navbar;
